angular.module('managerApp')
  .config(($stateProvider) => {
    $stateProvider
      .state('paas.cda', {
        url: '/cda',
        template: '<div data-ui-view="cdaDetails"></div>',
        translations: ['.'], 
resolve: {
translations($q, $translate, asyncLoader) { const imports = [ import(`/Users/jleveugle/Documents/Work/github/ovh-ux/ovh-manager-cloud/client/app/cda/translations/Messages_${$translate.use()}.xml`)
                    .catch(() => import(`/Users/jleveugle/Documents/Work/github/ovh-ux/ovh-manager-cloud/client/app/cda/translations/Messages_${$translate.fallbackLanguage()}.xml`))
                    .then(i => i.default),
                ]; imports.forEach(p => asyncLoader.addTranslations(p)); return $q.all(imports).then(() => $translate.refresh()); }},
        abstract: true,
      });
  })
  .run(($transitions, CdaService) => {
    $transitions.onSuccess({ to: 'paas.cda.**' }, (transition) => {
      CdaService.initDetails(transition.params().serviceName);
    });
  });
